import React, { Component } from "react";

class Resume extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-12">
            <h1 className="mb-5">Resume</h1>
          </div>
        </div>
        <div className="row">
          <div className="col-6 text-center">
            <h4 className="mb-5">Summary</h4>
            <p className="text-left">Driven, personable and motivated individual with a cerfication in Full-Stack Web Development. Currently seeking a role as an entry-level software developer or technical sales analyst. Skilled in front-end web development with significant exposure to back-end web development. </p>
            <br></br>
            <h4 className="mb-3">Education</h4>
            <p className="text-left"><strong>Cleveland State University</strong></p>
            <p className="text-left"> 2014 - 2018</p>
            <p className="text-left">Bachelor of Health Science, Minor in Business</p>
          </div>
          <div className="col-6 text-center">
            <h4 className="mb-5">Col 2</h4>
          </div>
        </div>
      </div>
    );
  }
}

export default Resume;
